import React from 'react'
import logo from '../images/logo.jpg'
import background from '../images/background.jpg'

export default function NavBar() {
    return (
        <div style={{background: "transparent", textAlign: "center", backgroundImage: `url(${background})`}}>
            <img alt="Star Wars" src={logo} style={{width: "200px", marginTop: "20px"}}/>
        </div>
    )
}
